import React, { useState, useEffect } from 'react';

const TransactionHistory = () => {
    const [transactions, setTransactions] = useState([]);
    const [incomeSummary, setIncomeSummary] = useState({
        totalIncome: 0,
        transactionCount: 0,
        monthlyIncome: 0
    });

    useEffect(() => {
        fetchTransactions();
        fetchIncomeSummary();
    }, []);

    const fetchTransactions = async () => {
        try {
            const response = await fetch('http://localhost:5000/api/transactions');
            const data = await response.json();
            setTransactions(data);
        } catch (error) {
            console.error('Error fetching transactions:', error);
        }
    };

    const fetchIncomeSummary = async () => {
        try {
            const response = await fetch('http://localhost:5000/api/transactions/summary/income');
            const data = await response.json();
            setIncomeSummary(data);
        } catch (error) {
            console.error('Error fetching income summary:', error);
        }
    };

    return (
        <div>
            <h1>ðŸ“‹ Transaction History</h1>

            <div className="stats-grid">
                <div className="stat-card">
                    <h3>Total Income</h3>
                    <div className="number">â‚¹{incomeSummary.totalIncome.toLocaleString()}</div>
                    <p>All time interest collected</p>
                </div>

                <div className="stat-card">
                    <h3>Total Transactions</h3>
                    <div className="number">{incomeSummary.transactionCount}</div>
                    <p>Interest collection transactions</p>
                </div>

                <div className="stat-card">
                    <h3>This Month Income</h3>
                    <div className="number">â‚¹{incomeSummary.monthlyIncome.toLocaleString()}</div>
                    <p>Interest collected this month</p>
                </div>
            </div>

            <div className="card">
                <h2>All Transactions</h2>
                {transactions.length > 0 ? (
                    <table className="table">
                        <thead>
                            <tr>
                                <th>Date</th>
                                <th>Client</th>
                                <th>Type</th>
                                <th>Amount</th>
                                <th>Description</th>
                                <th>Payment Method</th>
                            </tr>
                        </thead>
                        <tbody>
                            {transactions.map((transaction, index) => (
                                <tr key={index}>
                                    <td>{new Date(transaction.transactionDate).toLocaleDateString()}</td>
                                    <td>{transaction.client?.name || 'N/A'}</td>
                                    <td>
                                        <span className={`status-${transaction.type === 'interest' ? 'active' : 'closed'}`}>
                                            {transaction.type}
                                        </span>
                                    </td>
                                    <td>â‚¹{transaction.amount.toLocaleString()}</td>
                                    <td>{transaction.description}</td>
                                    <td>{transaction.paymentMethod}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                ) : (
                    <p>No transactions found.</p>
                )}
            </div>
        </div>
    );
};

export default TransactionHistory;
